import profile from '../assets/persona.svg';
import experience from '../assets/case.svg';
import projects from '../assets/notebook.svg';
import training from '../assets/study.svg';
import skills from '../assets/skill.svg';
import contacts from '../assets/message.svg';

const menuList = [
  {
    index: '1',
    title: 'Profils & Technologies',
    imageUrl: profile,
    imageAlt: 'Profils & Technologies',
  },
  {
    index: '2',
    title: 'Expériences Professionnelles',
    imageUrl: experience,
    imageAlt: 'Expériences Professionnelles',
  },
  {
    index: '3',
    title: 'Projets',
    imageUrl: projects,
    imageAlt: 'Projets',
  },
  {
    index: '4',
    title: 'Formations',
    imageUrl: training,
    imageAlt: 'Formations',
  },
  {
    index: '5',
    title: 'Compétences',
    imageUrl: skills,
    imageAlt: 'Compétences',
  },
  {
    index: '6',
    title: 'Contacts',
    imageUrl: contacts,
    imageAlt: 'Contacts',
  },
];

export default menuList;
